import React from "react";

const FileDisplay = ({ file, headers }) => {
  return (
    <div className="file-display">
    <div className="file-header">

    </div>
      {file.name}
      {headers.map((header) => {
        return <div>{header}</div>;
      })}
    </div>
  );
};

export default FileDisplay;
